import React from 'react';

import {NavLink} from 'react-router-dom'

const Enigma = (props) => {
    return (
        <NavLink className="enigma" to={props.path}>
            <div className="enigma-title">
                <h2>
                    {props.title}
                </h2>
            </div>
        </NavLink>
    );
};

export default Enigma;
